import React, { Component } from 'react';
import './App.css';

class App extends Component {
    render() {
        return (
            <div className="APP">
                <h1 className="title">두잇! 리액트 시작하기</h1>
                <h1 className="title">두잇! 리액트 시작하기</h1>
            </div>
        );
    }
}

export default App;
